バイナンスCEOのCZは、リスボンで行われたWeb Summitで、金融不安の中でクリプトが唯一安定しているだろうと述べました。
クリプトの基本技術や供給量の制限を考慮すると、この混乱した金融状況の中で、クリプトが技術的に最も安定していると考えているようです
